import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the '+ New Event' button to be visible and clickable
    await page.waitForSelector('a.nav-link.create-btn', { state: 'visible' });

    // Click the '+ New Event' button
    await page.click('a.nav-link.create-btn');

    // Wait for navigation to complete
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_navigated_to_create_event.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_navigated_to_create_event.png'));

    // Verify that we are on the create event page by checking for a specific element
    const isCreateEventPage = await page.isVisible('h2:has-text("Create Event")');

    return {
      success: true,
      action: "Navigated to the create event page",
      extractedData: { isCreateEventPage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
